eval("module.exports = [{\"quizId\":89,\"allowQuizAgain\":false,\"registrationNumber\":\"sbd001\",\"listQuestions\":[{\"description\":\"Chronobiology might sound a little futuristic – like something from a science fiction novel, perhaps – but it’s actually a field of study that concerns one of the oldest processes life on this planet has ever known: short-term rhythms of time and their effect on flora and fauna. This can take many forms. Marine life, for example, is influenced by tidal patterns. Animals tend to be active or inactive depending on the position of the sun or moon. Numerous creatures, humans included, are largely diurnal – that is, they like to come out during the hours of sunlight. Nocturnal animals, such as bats and possums, prefer to forage by night. A third group are known as crepuscular: they thrive in the low-light of dawn and dusk and remain inactive at other hours. What is this paragraph about?\",\"questionType\":\"ONE\",\"checkboxSelected\":[],\"radioSeletected\":\"2\",\"listAnswers\":[{\"id\":1,\"content\":\"A brief introduction of chronobiology\",\"isCorrect\":false,\"answerByUser\":false},{\"id\":2,\"content\":\"Explanation of how futuristic chronobiology is\",\"isCorrect\":true,\"answerByUser\":false},{\"id\":3,\"content\":\"Subdivisions of chronobiology\",\"isCorrect\":false,\"answerByUser\":false},{\"id\":4,\"content\":\"Generally 3,000 homeless people may be benefited by the approving program.\",\"isCorrect\":false,\"answerByUser\":false}],\"id\":959,\"correctAnswers\":false,\"nhomCauHoiId\":\"\",\"isCheck\":false,\"questionStatus\":\"CURRENT\",\"difficult\":\"TB\",\"category\":\"ly-luan-chung\",\"lastModified\":\"2018-11-30T09:48:50.375Z\",\"lastModifiedUserId\":1,\"answersForAQuestions\":[]},{\"description\":\"Work forms a major part of most people's lives. For some, it is boring, so routine and dehumanizing that it is highly stressful and each day becomes something to be endured with difficulty. For others, work is so exciting that they would far rather be working than doing anything else. For some, it is a source of self-esteem; for others, the treatment they receive totally destroys any self-esteem they may have had. Many marriage breakdowns are blamed on the stresses and demands of one partner's job (or both partners' jobs). Some jobs have specific health or physical risks associated with them. More generally, sickness rates correlate with different sorts of work. Studies show that to be without a job at all is highly stressful, destructive of self-esteem, and associated with ill health and relationship difficulties. This paragraph is NOT about:\",\"questionType\":\"ONE\",\"checkboxSelected\":[],\"radioSeletected\":\"2\",\"listAnswers\":[{\"id\":1,\"content\":\"Work is a major part of life\",\"isCorrect\":false,\"answerByUser\":false},{\"id\":2,\"content\":\"Jobs that people do for a living\",\"isCorrect\":true,\"answerByUser\":false},{\"id\":3,\"content\":\"How work affects people’s lives\",\"isCorrect\":false,\"answerByUser\":false},{\"id\":4,\"content\":\"Students should be expelled from school for violating the “no-bullying” policy.\",\"isCorrect\":false,\"answerByUser\":false}],\"id\":965,\"correctAnswers\":false,\"nhomCauHoiId\":\"\",\"isCheck\":false,\"questionStatus\":\"ACTIVE\",\"difficult\":\"TB\",\"category\":\"ly-luan-chung\",\"lastModified\":\"2018-11-30T09:48:51.808Z\",\"lastModifiedUserId\":1,\"answersForAQuestions\":[]},{\"description\":\"The British psychoanalyst John Bowlby maintains that separation from the parents during the sensitive attachment period from birth to three may scar a child's personality and predispose to emotional problems in later life. Some people have drawn the conclusion from Bowlby's work that children should not be subjected to day care before the age of three because of the parental separation it entails, and many people do believe this. But there are also arguments against such a strong conclusion. Firstly, anthropologists point out that the insulated love affair between children and parents found in modern societies does not usually exist in traditional societies. For example, in some tribal societies, such as the Ngoni, the father and mother of a child did not rear their infant alone—far from it. Secondly, common sense tells us that day care would not be so widespread today if parents, caretakers found children had problems with it. Statistical studies of this kind have not yet been carried out, and even if they were, the results would be certain to be complicated and controversial. Thirdly, in the last decade there have been a number of careful American studies of children in day care, and they have uniformly reported that day care had a neutral or slightly positive effect on children's development, but tests that have had to be used to measure this development are not widely enough accepted to settle the issue. But Bowlby's analysis raises the possibility that early day care has delayed effects. The possibility that such care might lead to, say, more mental illness or crime 15 or 20 years later can only be explored by the use of statistics. Whatever the long-term effects, parents sometimes find the immediate effects difficult to deal with. Children fewer than three are likely to protest at leaving their parents and show unhappiness. At the age of three or three and a half almost all children find the transition to nursery easy, and this is undoubtedly why more and more parents make use of childcare at this time. The matter, then, is far from clear-cut, though experience and available evidence indicate that early care is reasonable for infants. Which of the following statements would Bowlby support?\",\"questionType\":\"ONE\",\"checkboxSelected\":[],\"radioSeletected\":\"3\",\"listAnswers\":[{\"id\":1,\"content\":\"Statistical studies should be carried out to assess the positive effect of day care for children at the age of three or older.\",\"isCorrect\":false,\"answerByUser\":false},{\"id\":2,\"content\":\"Early day care can delay the occurrence of mental illness in children.\",\"isCorrect\":false,\"answerByUser\":false},{\"id\":3,\"content\":\"The first three years of one's life is extremely important to the later development of personality.\",\"isCorrect\":true,\"answerByUser\":false},{\"id\":4,\"content\":\"He neither agrees or disagrees with Bowlby’s theory and feels that there should be statistics used to settle the issue.\",\"isCorrect\":false,\"answerByUser\":false}],\"id\":962,\"correctAnswers\":false,\"nhomCauHoiId\":\"\",\"isCheck\":false,\"questionStatus\":\"ACTIVE\",\"difficult\":\"TB\",\"category\":\"ly-luan-chung\",\"lastModified\":\"2018-11-30T09:48:51.446Z\",\"lastModifiedUserId\":1,\"answersForAQuestions\":[]},{\"description\":\"A Boeing 777, one of the world's most reliable types of airliners, is missing, and no one knows why. Was it a bomb? Mechanical failure? A hijacking gone awry? Pilots and others in the aviation community are deeply disturbed by the mystery surrounding Malaysia Airlines Flight 370. It disappeared Saturday en route from Kuala Lumpur to Beijing over the Gulf of Thailand, somewhere between Malaysia and Vietnam. It's hard to believe that such huge questions remain four days after the Boeing 777-200ER went missing, carrying 227 passengers and 12 crew members. A revelation Tuesday set off a fresh wave of speculation. Radar tracking detected the plane hundreds of miles off course, traveling in the opposite direction from its original destination, a senior Malaysian Air Force official told CNN. The aircraft had stopped sending identifying transponder codes before it disappeared, the official said. The new details marked a dramatic twist in the investigation. But some reports have quoted other Malaysian authorities offering conflicting information, with some denying the military official's claim. The situation is so unprecedented that experts have been careful in speculating about possible explanations. How many passengers were carried on the missing airplane?\",\"questionType\":\"ONE\",\"checkboxSelected\":[],\"radioSeletected\":\"1\",\"listAnswers\":[{\"id\":1,\"content\":\"227\",\"isCorrect\":true,\"answerByUser\":false},{\"id\":2,\"content\":\"239\",\"isCorrect\":false,\"answerByUser\":false},{\"id\":3,\"content\":\"12\",\"isCorrect\":false,\"answerByUser\":false},{\"id\":4,\"content\":\"18\",\"isCorrect\":false,\"answerByUser\":false}],\"id\":964,\"correctAnswers\":false,\"nhomCauHoiId\":\"\",\"isCheck\":false,\"questionStatus\":\"ACTIVE\",\"difficult\":\"TB\",\"category\":\"ly-luan-chung\",\"lastModified\":\"2018-11-30T09:48:51.707Z\",\"lastModifiedUserId\":1,\"answersForAQuestions\":[]},{\"description\":\"Many cashew eaters may be surprised to learn about the origins of the popular nut. The nut comes from the cashew tree, a small evergreen tree in the flowering plant family Anacardiancese. North western Brazil is the native home of the plant, but it is now cultivated in all regions with sufficient tropical conditions. India, Vietnam, and Brazil, in that order, are the largest producers of cashew nuts. The cashew tree produces cashew flowers that yield cashew apples. These apples, better known in Central America as marañón, are oval to pear-shaped and ripen into a yellow and/or red structure between 5 to 11 centimeters long. These apples are the tree's false fruit and look like oversized hot peppers or pears. The real fruit of the tree are the small kidney-shaped drupes that protrude from under the pseudo fruit, the cashew apples. In botany, a drupe is a type of fruit in which an outer fleshy part surrounds a shell of hardened endocarp, the pit or stone, with a seed inside. Hidden inside each drupe is the cashew flower’s single seed, a single cashew. The seed, or cashew nut, is surrounded by a double shell containing a caustic phenolic resin, urushiol, a potent skin-irritating toxin also found in poison-ivy. The urushiol must be removed from the dark green nut shells before the seed inside is processed for consumption; this is done by shelling the nuts, a somewhat hazardous process, and exceedingly painful skin rashes among processing workers who come in contact with the toxin are common. According to the passage, cashews can be cultivated in Canada\",\"questionType\":\"ONE\",\"checkboxSelected\":[],\"radioSeletected\":\"1\",\"listAnswers\":[{\"id\":1,\"content\":\"True\",\"isCorrect\":true,\"answerByUser\":false},{\"id\":2,\"content\":\"False\",\"isCorrect\":false,\"answerByUser\":false},{\"id\":3,\"content\":\"Not given\",\"isCorrect\":false,\"answerByUser\":false}],\"id\":966,\"correctAnswers\":false,\"nhomCauHoiId\":\"\",\"isCheck\":false,\"questionStatus\":\"ACTIVE\",\"difficult\":\"TB\",\"category\":\"ly-luan-chung\",\"lastModified\":\"2018-11-30T09:48:51.907Z\",\"lastModifiedUserId\":1,\"answersForAQuestions\":[]}],\"beginTime\":\"2018-12-03T04:09:37.527Z\",\"id\":1468,\"isCheck\":false,\"phongThi\":\"PT001\",\"userId\":682,\"quizType\":\"REAL_QUIZ\",\"userquizStatus\":\"COMPLETED\",\"status\":\"\",\"lastModified\":1,\"timeBeginQuiz\":\"2018-12-03T04:09:37.530Z\",\"timeLastModified\":\"2018-12-03T04:10:17.529Z\",\"user\":{\"roleId\":2,\"username\":\"sbd001\",\"email\":\"sbd-sbd001@vinaas.com\",\"id\":682,\"isCheck\":false,\"tenNhanVien\":\"Bùi Kim Quyên\",\"soBaoDanh\":\"sbd001\",\"ngaySinh\":\"1991-07-07T17:00:00.000Z\",\"phongThi\":\"PT001\",\"passwordGenerated\":\"sxvkjj\"},\"summary\":{\"result\":\"FAILED\",\"correct\":0,\"total\":5,\"answeredPeriod\":0}}];\n\n//# sourceURL=webpack:///./src/pages/data_question_doc_hieu_Ielts.json?");

